from sys import stdin

N = int(stdin.readline().rstrip())
arr = []
for _ in range(N):
    arr.append(int(stdin.readline().rstrip()))

for idx in range(N):
    arr[idx] = max(arr[:idx] + arr[idx+1:])

for num in arr:
    print(num)

